import { View, Text } from "react-native";
import Login from "./Login";
import { Route, Switch } from "react-router-native";

const Main = () => {
  return (
    <View>
      <Switch>
        <Route path="/" exact>
          <Login></Login>
        </Route>
      </Switch>
    </View>
  );
};

export default Main;
